export class Produit {
  constructor(id, code, marque, modele, caracteristiques, prixUnitaire, quantite, Lignes, categorie, categorieId) {
    this.id = id;
    this.code = code;
    this.marque = marque;
    this.modele = modele;
    this.caracteristiques = caracteristiques;
    this.prixUnitaire = prixUnitaire;
    this.quantite = quantite;
    this.Lignes = Lignes;
    this.categorie = categorie;
    this.categorieId = categorieId;
  }

}
